import React from 'react'

function Member(props) {
    const {member} = props;
    return (
        <div>
            <div class="row">
                <div class="col">
                { member.firstName }
                </div>
                <div class="col-5">
                2 of 3 (wider)
                </div>
                <div class="col">
                3 of 3
                </div>
            </div>
        </div>
    )
}


export default Member;
